import { useEffect, useState } from "react";
import { Link } from "react-router-dom";

function Products() {
  const [categories, setCategories] = useState([]);

  const getDet = () => {
    fetch("http://localhost:8080/categories")
      .then((response) => response.json())
      .then((allDet) => setCategories(allDet[0].variety));
  };

  useEffect(() => {
    getDet();
  }, [true]);

  return (
    <div className="container products my-4">
      <h1 className="text-center" key="hi">Products</h1>
      <div className="row row-cols-2 row-cols-sm-3 row-cols-lg-5">
        {categories.map((item) => {
          return (
            <Link to="/products" state={item}>
              <div className="col mb-4" key={item}>
                <div className="card" style={{ width: "10rem", border: "none", cursor: "pointer" }}>
                  <img src="" className="card-img-top" alt="..." style={{ borderRadius: "50%" }} />
                  <div className="card-body">
                    <h5 className="card-title text-center">{item}</h5>
                  </div>
                </div>
              </div>
            </Link>
          )
        })}
      </div>
    </div>
  )
};
export default Products;
